import "./BottomRightMenu.css";
// import pancake from "/images/pancake.jpeg";

function BottomRightMenu() {
  return (
    <div className="container">
      {/* <img src={pancake} alt="pancake-dessert" /> */}
      <div className="bottom-right">
        <h1 className="bottom-right-name">Pancake</h1>
        <p className="bottom-right-description">
          Млечно - Бело - Темно чоколадо, банана, јагода, пченично брашно,
          путер, млеко, квасец, сол, шеќер, јајца, ванилин, вода.
        </p>
        <h6 className="bottom-right-alergy">
          АЛЕРГЕН: Млеко, глутен, кикирики, јајца
        </h6>
        <h1 className="bottom-right-price">230den</h1>
      </div>
    </div>
  );
}

export default BottomRightMenu;
